text:
Diml innehåller en egen definition av datatyper mellan olika käll- och destinationssystem.
Datatyper anges på t.ex. kolumner på följande sätt;
Observera att Diml gör skillnad mellan versaler och germaner och att datatypen som anges i id-fältet för dimlDataType skall vara det som anges i Id-kolumnen ovan.
Såhär definieras t.ex. en integer;
Typen string är en sekvens av tecken och kan innehålla både siffror, bokstäver och specialtecken.
Tillgängliga attribut;
Typen integer är ett heltal som beroende på om det kan vara negativt eller ej (isUnsigned) och antal bitar (bits) representerar ett tal med ett givet intervall.
